(193189, 0, NULL, NULL, NULL, NULL, 0, 'heart-mantra', 'Heart Mantra', '<p>Shivveda\'s Heart Mantra Capsules are a unique blend of ancient Ayurvedic wisdom and modern scientific research, designed to support your heart health naturally. Crafted with a meticulous selection of potent herbs and natural ingredients, these capsules work synergistically to promote cardiovascular wellness, enhance vitality, and maintain overall well-being.</p>\n<p><strong>Key Benefits:</strong></p>\n<ul>\n<li>\n<strong>Supports Heart Health:</strong> Formulated with herbs known for their cardioprotective properties, Heart Mantra Capsules help in maintaining healthy blood pressure and cholesterol levels.</li>\n<li>\n<strong>Promotes Circulation:</strong> Enhances blood flow and oxygen delivery to the heart, ensuring optimal cardiovascular function.</li>\n<li>\n<strong>Reduces Stress:</strong> Contains adaptogenic herbs that help in reducing stress and anxiety, which are crucial for heart health.</li>\n<li>\n<strong>Antioxidant Protection:</strong> Rich in antioxidants, these capsules combat oxidative stress and protect the heart from free radical damage.</li>\n<li>\n<strong>Natural Ingredients:</strong> Made with 100% natural and high-quality ingredients, ensuring no harmful side effects.</li>\n</ul>\n<p><strong>Why Choose Shivveda Heart Mantra Capsules?</strong></p>\n<ul>\n<li>\n<strong>Ayurvedic Formulation:</strong> Rooted in the time-tested principles of Ayurveda, offering a holistic approach to heart health.</li>\n<li>\n<strong>High-Quality Ingredients:</strong> Sourced from the finest herbs and natural sources, ensuring purity and potency.</li>\n<li>\n<strong>No Side Effects:</strong> Free from artificial additives, preservatives, and synthetic chemicals.</li>\n<li>\n<strong>Easy to Use:</strong> Convenient capsule form for easy daily consumption.</li>\n</ul>\n<p><strong>Ingredients:</strong></p>\n<ul>\n<li>\n<strong>Arjuna:</strong> Renowned for its heart-strengthening properties, helps maintain healthy blood pressure and cholesterol levels.</li>\n<li>\n<strong>Ashwagandha:</strong> An adaptogen that reduces stress and anxiety, promoting overall heart health.</li>\n<li>\n<strong>Garlic:</strong> Known for its ability to support cardiovascular health by improving blood flow and reducing cholesterol.</li>\n<li>\n<strong>Guggul:</strong> Helps in regulating lipid levels and supporting healthy cholesterol levels.</li>\n<li>\n<strong>Turmeric:</strong> A powerful antioxidant that protects the heart from oxidative stress.</li>\n</ul>\n<p><strong>Dosage:</strong> Take 1-2 capsules daily with water, preferably after meals, or as directed by a healthcare professional.</p>\n<p><strong>Customer Testimonials:</strong></p>\n<ul>\n<li>\"Since I started taking Heart Mantra Capsules, my blood pressure has stabilized, and I feel more energetic.\" - Rajesh K.</li>\n<li>\"These capsules have been a game-changer for my heart health. Highly recommend them!\" - Priya S.</li>\n</ul>\n<p><strong>Take the Step Towards a Healthier Heart Today!</strong> Prioritize your heart health with Shivveda Heart Mantra Capsules and experience the natural power of Ayurveda. Order now and embark on a journey towards a healthier, happier life.</p>', 'Shivveda Private Limited', 'Health & Beauty', 'Heart Mantra', NULL, '1', 'Title', 'Default Title', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'shopify', '992', 'deny', 'manual', '999', '1399', '1', '0', NULL, 'https://cdn.shopify.com/s/files/1/0647/0297/2042/files/DSC00042.jpg?v=1730618453', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'kg', NULL, NULL, '1', NULL, NULL, '1', NULL, NULL),
