(193211, 0, NULL, NULL, NULL, NULL, 0, 'kaya-trim-ras', 'Kaya Trim Ras - Strawberry Flavor | Weight Loss & Metabolism Booster', '<p><strong><em>Kaya Trim Ras is an ayurvedic medicine made from 15 precious herbs which helps in reducing weight without any side effects. Using it continuously for 3 months gives amazing benefits.</em></strong></p>\n<p dir=\"ltr\"><strong>1:Drink 2 to 3 litres of water a day</strong></p>\n<p dir=\"ltr\"><strong>2:Eat salad 15 minutes before eating food.</strong></p>\n<p dir=\"ltr\"><strong>3:Don\'t eat fried pizza and burger from the market</strong></p>\n<p dir=\"ltr\"><strong>4:It is mandatory to walk for at least 20 minutes in the morning and evening. By doing this, you will get amazing results.</strong></p>\n<p dir=\"ltr\"><strong>Drink 20 ml of Kaya Trim by adding it to hot water on an empty stomach. And after eating dinner at night, drink 20 ml by adding it to hot water.</strong><strong><em></em></strong></p>\n<p><strong>Ideal for those seeking to lose weight and improve their well-being, Kaya Trim Ras is your go-to solution. Experience the benefits of increased energy, reduced body fat, and a healthier lifestyle with this 100% Ayurvedic product. Enjoy the delicious taste while transforming your health.</strong></p>\n<p><strong> weight loss, metabolism booster, Ayurvedic, natural ingredients, strawberry flavor.</strong></p>\n<p><strong><em><br></em></strong></p>', 'Shivveda Private Limited', 'Health & Beauty', 'weight loss syrup', 'Kaya Trim Fat Cutter with Green Tea | Natural Fat Burner', '1', '45 Days Kaya Trim Ras', '15 Days', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '500', 'shopify', '7840', 'deny', 'manual', '1099', '1499', '1', '0', NULL, 'https://cdn.shopify.com/s/files/1/0647/0297/2042/files/shiv_veda_png1.png?v=1738526479', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'100', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://cdn.sho