(193232, 0, NULL, NULL, NULL, NULL, 0, 'mahabring-raj', 'MAHA BHRINGRAJ', '<p>Transform your hair care routine with ShivVeda\'s Maha Bhringraj Oil, a 100% Ayurvedic remedy designed to stop hair fall and boost hair growth naturally. Infused with the goodness of potent herbs, this oil rejuvenates your scalp, fortifies hair roots, and prevents premature graying.</p>\n<p>Experience the ancient magic of Ayurveda with every drop. Maha Bhringraj Oil deeply nourishes your scalp, promoting thicker and healthier hair while adding a beautiful shine and reducing split ends. Ideal for all hair types, it not only halts hair fall but also revitalizes your hair\'s overall health and look.</p>\n<p>Witness visible results with consistent use—fuller, stronger hair and a marked decrease in hair loss. Bid farewell to thinning hair and embrace a new level of confidence. ShivVeda\'s natural formula ensures no harmful chemicals or side effects, just pure, effective care.</p>\n<p>Choose Maha Bhringraj Oil for a natural, powerful hair care solution. Let your hair shine with health and vitality, and rediscover the joy of gorgeous, voluminous locks. Trust in the power of Ayurveda and see the difference in your hair today.</p>\n<!---->', 'Shivveda Private Limited', 'Health & Beauty', NULL, NULL, '1', 'Choose', '15 Days', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'shopify', '0', 'deny', 'manual', '449', '999', '1', '0', NULL, 'https://cdn.shopify.com/s/files/1/0647/0297/2042/files/IMG-20240905-WA0086.jpg?v=1734591386', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'7', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://cdn.shopify.com/s/files/1/0647/0297/2042/files/IMG-20240905-WA0086.jpg?v=1734591386', 'kg', NULL, NULL, '1', NULL, NULL, '1', NULL, NULL),
