(193239, 0, NULL, NULL, NULL, NULL, 0, 'rama_buti', 'Naturally Balance Your Blood Sugar with Rama Buti – Ayurvedic Capsules for Diabetes Care', '<p>Discover the power of nature with <strong>Shivveda’s Rama Buti</strong>, crafted from 100% Ayurvedic ingredients to help manage diabetes the natural way. With powerful herbs like <strong>Kalonji, Shilajit, Bitter Gourd</strong>, and more, Rama Buti works to regulate blood sugar levels, rejuvenate your body, and combat diabetes-related fatigue. Whether you’re looking for a natural supplement to maintain your energy or balance your sugar levels, Rama Buti is your safe and effective solution.</p>\n<p>Take control of your health with Rama Buti – <strong>an all-natural, side-effect-free way to support your diabetes care</strong>!</p>', 'Shivveda', 'Health & Beauty', NULL, NULL, '1', 'Plans', '30 Days', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'shopify', '930', 'deny', 'manual', '799', '1799', '1', '0', NULL, 'https://cdn.shopify.com/s/files/1/0647/0297/2042/files/RAMA_BUTI_ADD_Mushtaq_Khan_02.jpg?v=1729366771', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://cdn.shopify.com/s/files/1/0647/0297/2042/files/RAMA_BUTI_ADD_Mushtaq_Khan_02.jpg?v=1729366771', 'kg', NULL, NULL, '1', NULL, NULL, '1', NULL, NULL),
